document.addEventListener('keydown', (event) => {
	if (document.activeElement.tagName === 'INPUT' || document.activeElement.tagName === 'TEXTAREA') return;
	if (event.key === 'x') {
		window.location.href = 'home.html';
	}
	if (event.key === 'y') {
		window.location.href = 'https://google.com';
	}
});